import React from "react";

const TodoItem = ({ list }) => {
  console.log("list", list);
  return (
    <div>
      <div>할 일</div>
      <div>{list?.content}</div>
      <div>날짜</div>
      <div>{list?.createdAt}</div>
      <div>했니?</div>
      <div>{list?.done}</div>
    </div>
  );
};

export default TodoItem;
